import{
  Link,
  BrowserRouter as Router,
  Routes,
  Route
}from 'react-router-dom'
import Home from "./Components/Home"
import Visit from "./Components/Visit"


function App() {
  return ( 
    <Router>
      <Routes>
        <Route path ="/" element={<Home />} />
        <Route path ="/visit" element={<Visit />} />
      </Routes>
    </Router>

  );
}

export default App;
